import React from "react";
import "../index.css"; // Import global styles

const Login = () => {
  return (
    <div className="container">
      <h2>Login</h2>
      <input type="text" placeholder="Username" />
      <input type="password" placeholder="Password" />
      <button>Login</button>
    </div>
  );
};

export default Login;
